import { React, useContext } from "react";
import ReactDOM from "react-dom";

import "./SideNavigation.css";
import { NavLink } from "react-router-dom";
import { AuthContext } from "../../context/auth-context";

const SideNavigation = (props) => {
  const auth = useContext(AuthContext);
  const content = <aside className="side-nav">{props.children}</aside>;

  return (
    <>
      <div id="mySidenav" class="sidenav" style={{ marginLeft: 0 + "em" }}>
        <ul>
          <li>
            <NavLink to="/dashboard">My Dashboard</NavLink>
          </li>
          <li>
            <NavLink to={`/${auth.userId}/wounds`}>Wounds</NavLink>
          </li>
          <li>
            <NavLink to={"/wounds/new"}>New Wound</NavLink>
          </li>
          <li>
            <NavLink to="/prescriptions">Prescriptions</NavLink>
          </li>
          <li>
            <NavLink to="/messages">Messages</NavLink>
          </li>
          <li>
            <NavLink to="/pictures">Upload a Picture</NavLink>
          </li>
        </ul>
      </div>
      <span onclick="openNav()">open</span>
    </>
  );
};

export default SideNavigation;
